const ContextQ2Form3 = () => {
  const [userList, setUserList] = useUserList();
  const handleReset = () => {
    setUserList({ id: 1, name: "홍길동", nickname: "히히" });
  };
  return (
    <div>
      <h1>Q2Form3</h1>
      <button
        onClick={() => {
          handleReset();
        }}
      >
        RESET
      </button>
    </div>
  );
};
export default ContextQ2Form3;
